import React from 'react'

const DetailedImageView = (props) => {
    console.log(props.image)
    const fetchData = () => {
        fetch(`https://nasa-file-search-backend.herokuapp.com/search/${props.imageId}`)
            .then(resp => resp.json())
            .then(json => {
            console.log(json)
        })
    }
    return (
        <div>
            {fetchData()}
      </div>  
    );
}

export default DetailedImageView;
